import styled from 'styled-components';

const Wrapper = styled.section`
padding-left: 13.5rem;
.c{
    .react-multiple-carousel__arrow--left{
        margin-bottom: 44rem;
        margin-left: 117.5rem;
    }
    position: unset;
    ul {
        display: flex;
        align-items: center;
        gap: 3rem;
        li{
            width: auto !important;
        }
    }
}




`;

export default Wrapper;
